// AboutPage.js
import React from 'react';
import './App.css';

function AboutPage() {
  return (
    <div className="AboutPage">
      <h1 className="header-text">About Madison</h1>
      <p className="subtext">This is the about page where you can learn more about Madison.</p>
    </div>
  );
}

export default AboutPage;
